import React from "react";
import { CamisetaStyle } from "./style";

function Camisetas(props){
    return(
        <CamisetaStyle>
            {props.foto}
            {props.nome}

            {props.comprar}
            {props.valor}
        </CamisetaStyle>
    )
}

export default Camisetas
